// frontend/src/components/Dashboard.js
import React, { useState } from 'react';
import {
  Container,
  Typography,
  Grid,
  Paper,
  Button,
  TextField,
  Select,
  MenuItem,
  Modal
} from '@mui/material';

const Dashboard = () => {
  const [asset, setAsset] = useState('');
  const [indicator1, setIndicator1] = useState('');
  const [indicator2, setIndicator2] = useState('');
  const [indicator3, setIndicator3] = useState('');
  const [step, setStep] = useState(1);
  const [open, setOpen] = useState(false);

  const handleOpen = () => setOpen(true);
  const handleClose = () => setOpen(false);

  const nextStep = () => setStep((prev) => prev + 1);
  const prevStep = () => setStep((prev) => prev - 1);

  const handleSubmit = () => {
    // Log the trade
    console.log('Trade Logged:', { asset, indicator1, indicator2, indicator3 });
    setStep(1); // Reset to step 1
    handleClose();
  };

  return (
    <Container>
      <Typography variant="h4" gutterBottom>
        Dashboard
      </Typography>
      <Grid container spacing={3}>
        {/* Trade Logging Section */}
        <Grid item xs={12}>
          <Paper elevation={3} style={{ padding: '16px' }}>
            <Typography variant="h6">Log a Trade</Typography>
            <Button variant="contained" color="primary" onClick={handleOpen}>
              Start Trade Logging
            </Button>

            <Modal open={open} onClose={handleClose}>
              <Paper elevation={3} style={{ padding: '32px', margin: '50px auto', maxWidth: '600px' }}>
                <Typography variant="h6" gutterBottom>
                  {`Step ${step}`}
                </Typography>

                {step === 1 && (
                  <>
                    <Typography>Select Asset:</Typography>
                    <Select
                      value={asset}
                      onChange={(e) => setAsset(e.target.value)}
                      fullWidth
                    >
                      <MenuItem value="Bitcoin">Bitcoin</MenuItem>
                      <MenuItem value="Apple">Apple</MenuItem>
                      {/* Add more assets */}
                    </Select>
                    <Button variant="contained" onClick={nextStep}>
                      Next
                    </Button>
                  </>
                )}

                {step === 2 && (
                  <>
                    <Typography>Select First Confluence Indicator:</Typography>
                    <Select
                      value={indicator1}
                      onChange={(e) => setIndicator1(e.target.value)}
                      fullWidth
                    >
                      <MenuItem value="Trend">Trend</MenuItem>
                      <MenuItem value="RSI">RSI</MenuItem>
                      {/* Add more indicators */}
                    </Select>
                    <Button onClick={prevStep}>Back</Button>
                    <Button variant="contained" onClick={nextStep}>
                      Next
                    </Button>
                  </>
                )}

                {step === 3 && (
                  <>
                    <Typography>Select Second Confluence Indicator:</Typography>
                    <Select
                      value={indicator2}
                      onChange={(e) => setIndicator2(e.target.value)}
                      fullWidth
                    >
                      <MenuItem value="Moving Average">Moving Average</MenuItem>
                      <MenuItem value="MACD">MACD</MenuItem>
                      {/* Add more indicators */}
                    </Select>
                    <Button onClick={prevStep}>Back</Button>
                    <Button variant="contained" onClick={nextStep}>
                      Next
                    </Button>
                  </>
                )}

                {step === 4 && (
                  <>
                    <Typography>Select Third Confluence Indicator:</Typography>
                    <Select
                      value={indicator3}
                      onChange={(e) => setIndicator3(e.target.value)}
                      fullWidth
                    >
                      <MenuItem value="Bollinger Bands">Bollinger Bands</MenuItem>
                      <MenuItem value="Stochastic Oscillator">Stochastic Oscillator</MenuItem>
                      {/* Add more indicators */}
                    </Select>
                    <Button onClick={prevStep}>Back</Button>
                    <Button variant="contained" onClick={handleSubmit}>
                      Log Trade
                    </Button>
                  </>
                )}
              </Paper>
            </Modal>
          </Paper>
        </Grid>
      </Grid>
    </Container>
  );
};

export default Dashboard;
